import React from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
const key = "https://api.themoviedb.org/3/search/movie?api_key=fe510bba0376ae09dd0a616963b70b24&query=";


const Search = () => {
  const movies = useParams();
  React.useEffect(() => {
    /* axios
      .get(`/api/movies/search/${movies}`)
      .then((movie) => console.log(movie))
      .catch((err) => err); */

      axios
        .get(`${key}${movies}`)
            .then((movie) => (movie.data).json())
            .then((mov) => console.log(mov) )
  });
  return <></>;
};

export default Search;
